    function remove(uint[] storage array, uint element) private {
        uint index;
        bool found = false;
        for(uint i = 0; i < array.length; i++) {
            if (array[i] == element) {
                index = i;
                found = true;
                break;
            }
        }
        require(found, "Element not present in array");
        array[index] = array[array.length - 1];
        array.pop();
    }

